import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function MoveList({ url }) {
  const [moves, setMoves] = useState([]);

  useEffect(() => {
    async function fetchMoveList() {
      try {
        const response = await axios.get(url);
        const { moves } = response.data;
        setMoves(moves.map(move => move.move.name));
      } catch (error) {
        console.error('Error fetching move list:', error);
      }
    }

    fetchMoveList();
  }, [url]);

  return (
    <div>
      <h2>Move List</h2>
      <ul>
        {moves.map(move => (
          <li key={move}>{move}</li>
        ))}
      </ul>
    </div>
  );
}
